function Contacts(props) {
  return (
    <div className="Contacts">
        {props.user.friend_list.map((item)=>{return <div>{item.first_name + " " + item.last_name }</div>})}
        <div>{props.Contacts.content}</div>
    </div>
  );
}

export default Contacts;
